import React from "react";

export default function PostCard(props) {
  return (
    <div className="PostCard">
      <div className="post">
        <img src={props.post.cover} alt={props.title} />
        <div key={props.id} className="post-card">
          <h1>{props.title}</h1>
          <p>{props.body}</p>
        </div>
      </div>
    </div>
  );
}
